import React, { useEffect, useState } from "react";
import { getCash } from "../api/CashApi"; // Ensure this is the correct path

const Cash = () => {
  const [cashData, setCashData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchCashData = async () => {
      try {
        const data = await getCash();
        if (Array.isArray(data)) {
          setCashData(data);
        } else {
          console.warn("Expected an array but got:", data);
          setCashData([]);
        }
      } catch (error) {
        setError("Error fetching cash data");
        console.error("Error fetching cash data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchCashData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div>
      <h1>Cash Data</h1>
      <table className="cash-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Entry Date</th>
            <th>Initial Cash</th>
            <th>User ID</th>
          </tr>
        </thead>
        <tbody>
          {cashData.map((cash) => (
            <tr key={cash.id}>
              <td>{cash.id}</td>
              <td>{cash.entry_date}</td>
              <td>{cash.initial_cash}</td>
              <td>{cash.user_id}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Cash;
